INSERT INTO `peliculas` (`id`, `nombre`, `img`, `duracion`, `puntuacion`, `fechaEstreno`, `sinopsis`, `genero`) VALUES
(1, 'Terminator', , 108, 10, '1984-10-26', 'En el año 2029 las máquinas dominan el mundo. Los rebeldes que luchan contra ellas tienen como líder a John Connor, un hombre que nació en los años ochenta. Para eliminarlo y así acabar con la rebelión, las máquinas envían al pasado el robot Terminator con la misión de matar a Sarah Connor, la madre de John, e impedir así su nacimiento. Sin embargo, un hombre del futuro intentará protegerla.', 'Ciencia ficción');
INSERT INTO `peliculas` (`id`, `nombre`, `img`, `duracion`, `puntuacion`, `fechaEstreno`, `sinopsis`, `genero`) VALUES
(2, 'Joker', , 122, 10, '2019-06-19', 'La pasión de Arthur Fleck, un hombre ignorado por la sociedad, es hacer reír a la gente. Sin embargo, una serie de trágicos sucesos harán que su visión del mundo se distorsione considerablemente convirtiéndolo en un brillante criminal.', 'Drama');
INSERT INTO `peliculas` (`id`, `nombre`, `img`, `duracion`, `puntuacion`, `fechaEstreno`, `sinopsis`, `genero`) VALUES
(3, 'Terminator 2: el juicio final', , 137, 8, '1991-12-05', 'Sarah Connor, la madre soltera del rebelde John Connor, está ingresada en un psiquiátrico. Algunos años antes, un viajero del tiempo le había revelado que su hijo sería el salvador de la humanidad en un futuro -año 2029- dominado por las máquinas. Se convirtió entonces en una especie de guerrera y educó a su hijo John en tácticas de supervivencia. Esta es la razón por la que está recluida en un manicomio. Cuando un nuevo androide mejorado, un T-1000, llega del futuro para asesinar a John, un viejo modelo T-800 será enviado para protegerle.', 'Ciencia ficción');
INSERT INTO `peliculas` (`id`, `nombre`, `img`, `duracion`, `puntuacion`, `fechaEstreno`, `sinopsis`, `genero`) VALUES
(4, 'Alien: el octavo pasajero', , 115, 9, '1979-05-25', 'La tripulación del remolcador espacial Nostromo atiende una señal de socorro y, sin saberlo, sube a bordo una letal forma de vida extraterrestre.', 'Terror');
INSERT INTO `peliculas` (`id`, `nombre`, `img`, `duracion`, `puntuacion`, `fechaEstreno`, `sinopsis`, `genero`) VALUES
(5, 'Aliens: el regreso', , 137, 8, '1986-07-18', 'Tras escapar de la nave Nostromo, la teniente Ripley tiene que enfrentarse de nuevo a los aliens en una colonia minera.', 'Terror');
INSERT INTO `peliculas` (`id`, `nombre`, `img`, `duracion`, `puntuacion`, `fechaEstreno`, `sinopsis`, `genero`) VALUES
(6, 'El club de los poetas muertos', , 128, 6, '1989-11-22', 'Un grupo de alumnos descubre la importancia de perseguir los sueños gracias a un profesor que despierta sus mentes con métodos poco convencionales.', 'Drama');
INSERT INTO `peliculas` (`id`, `nombre`, `img`, `duracion`, `puntuacion`, `fechaEstreno`, `sinopsis`, `genero`) VALUES
(7, 'Avatar', , 161, 7, '2009-12-15', 'Entramos en el mundo Avatar de la mano de Jake Sully, un ex-Marine en silla de ruedas, que ha sido reclutado para viajar a Pandora, donde existe un mineral raro y muy preciado que puede solucionar la crisis energética existente en la Tierra.', 'Animación');
INSERT INTO `peliculas` (`id`, `nombre`, `img`, `duracion`, `puntuacion`, `fechaEstreno`, `sinopsis`, `genero`) VALUES
(8, 'Shrek', , 92, 6, '2001-12-15', 'Hace mucho tiempo, en una lejana ciénaga, vivía un ogro llamado Shrek. Un día, su preciada soledad se ve interrumpida por un montón de personajes de cuento de hadas que invaden su casa. Todos fueron desterrados de su reino por el malvado Lord Farquaad. Decidido a devolverles su reino y recuperar la soledad de su ciénaga, Shrek llega a un acuerdo con Lord Farquaad y va a rescatar a la princesa Fiona, la futura esposa del rey. Sin embargo, la princesa esconde un oscuro secreto.', 'Animacion');
INSERT INTO `peliculas` (`id`, `nombre`, `img`, `duracion`, `puntuacion`, `fechaEstreno`, `sinopsis`, `genero`) VALUES
(9, 'Interstellar', , 169, 10, '2014-10-26', 'Un grupo de científicos y exploradores, encabezados por Cooper, se embarcan en un viaje espacial para encontrar un lugar con las condiciones necesarias para reemplazar a la Tierra y comenzar una nueva vida allí. La Tierra está llegando a su fin y este grupo necesita encontrar un planeta más allá de nuestra galaxia que garantice el futuro de la raza humana.', 'Ciencia Ficcion');
INSERT INTO `peliculas` (`id`, `nombre`, `img`, `duracion`, `puntuacion`, `fechaEstreno`, `sinopsis`, `genero`) VALUES
(10, 'WALL E', , 98, 9, '2008-06-05', 'Tras cientos de años haciendo aquello para lo que fue construido: limpiar el planeta de basura, el pequeño robot Wall-e tiene una nueva misión cuando conoce a Eva.', 'Animacion');
INSERT INTO `peliculas` (`id`, `nombre`, `img`, `duracion`, `puntuacion`, `fechaEstreno`, `sinopsis`, `genero`) VALUES
(12, 'Star Wars: Episodio IV', , 121, 9, '1977-05-25', 'La nave en la que viaja la princesa Leia es capturada por las tropas imperiales al mando del temible Darth Vader. Antes de ser atrapada, Leia consigue introducir un mensaje en su robot R2-D2, quien acompañado de su inseparable C-3PO logran escapar. Tras aterrizar en el planeta Tattooine son capturados y vendidos al joven Luke Skywalker, quien descubrirá el mensaje oculto que va destinado a Obi Wan Kenobi, maestro Jedi a quien Luke debe encontrar para salvar a la princesa.', 'Ciencia Ficcion');

